import React from "react";
import "./PhotoGrid.css"; // Ensure this file exists

const photos = [
  {
    id: 1,
    src: "https://images.unsplash.com/photo-1597841284155-4c74363b1981?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Butter Chicken",
  },
  {
    id: 2,
    src: "https://images.unsplash.com/photo-1614189964166-648f9f6a60bc?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Palak Paneer",
  },
  {
    id: 3,
    src: "https://images.unsplash.com/photo-1623402923786-f65f6c528618?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Aloo Gobi",
  },
  {
    id: 4,
    src: "https://images.unsplash.com/photo-1610567004730-f73a89b2762e?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Chole Bhature",
  },
  {
    id: 5,
    src: "https://images.unsplash.com/photo-1604907666614-40f4d8c47ed3?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Paneer Tikka",
  },
  {
    id: 6,
    src: "https://images.unsplash.com/photo-1626174549690-d7d8ccf6b7bc?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Dal Makhani",
  },
  {
    id: 7,
    src: "https://images.unsplash.com/photo-1613400788567-dc9b1e13c4ff?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Samosa",
  },
  {
    id: 8,
    src: "https://images.unsplash.com/photo-1603947678821-2c2aeb451a8c?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Lassi",
  },
  {
    id: 9,
    src: "https://images.unsplash.com/photo-1587461582210-0a9e09321bb9?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Biryani",
  },
  {
    id: 10,
    src: "https://images.unsplash.com/photo-1610547535282-1d2da7cd8e1b?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Kadai Paneer",
  },
  {
    id: 11,
    src: "https://images.unsplash.com/photo-1594007785540-739b1a1f3f3c?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Tandoori Chicken",
  },
  {
    id: 12,
    src: "https://images.unsplash.com/photo-1576498292595-d3e7f146bda0?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Pav Bhaji",
  },
  {
    id: 13,
    src: "https://images.unsplash.com/photo-1607746739161-d7bc4ec0f567?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Rajma",
  },
  {
    id: 14,
    src: "https://images.unsplash.com/photo-1588853970631-bb7cb78e45f5?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Baingan Bharta",
  },
  {
    id: 15,
    src: "https://images.unsplash.com/photo-1571985765603-5c01e09e7056?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Dhokla",
  },
  {
    id: 16,
    src: "https://images.unsplash.com/photo-1610567004766-1559f3fbd017?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Gulab Jamun",
  },
  {
    id: 17,
    src: "https://images.unsplash.com/photo-1625887762701-1e3dc6d65b89?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Kheer",
  },
  {
    id: 18,
    src: "https://images.unsplash.com/photo-1587090627033-91bc6ccf96b5?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Chaat",
  },
  {
    id: 19,
    src: "https://images.unsplash.com/photo-1591041107797-d1f9be99cb93?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Palak Chole",
  },
  {
    id: 20,
    src: "https://images.unsplash.com/photo-1617370857028-5b3e7d3efed1?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=400",
    alt: "Methi Thepla",
  },
];

const SectionTwo = () => {
  return (
    <div className="relative overflow-hidden my-10 px-4">
      {" "}
      {/* Added vertical margin and horizontal padding */}
      <h2 className="text-3xl font-bold text-center mb-10">
        Explore Our Culinary Delights
      </h2>{" "}
      {/* Increased bottom margin */}
      <div className="flex animate-slide min-h-[250px] justify-center py-4">
        {" "}
        {/* Added vertical padding */}
        {photos.map((photo) => (
          <div
            key={photo.id}
            className="photo-card transform transition-transform duration-500 hover:scale-105 mx-4" // Increased horizontal margin for spacing
          >
            <img
              src={photo.src}
              alt={photo.alt}
              className="w-48 h-48 object-cover rounded-lg mb-3" // Added bottom margin to images
            />
            <div className="p-3">
              <h3 className="text-lg font-semibold">{photo.alt}</h3>
            </div>
          </div>
        ))}
        {/* Duplicate for infinite scroll effect */}
        {photos.map((photo) => (
          <div
            key={photo.id + 100} // Unique key
            className="photo-card transform transition-transform duration-500 hover:scale-105 mx-4" // Increased horizontal margin for spacing
          >
            <img
              src={photo.src}
              alt={photo.alt}
              className="w-48 h-48 object-cover rounded-lg mb-3" // Added bottom margin to images
            />
            <div className="p-3">
              <h3 className="text-lg font-semibold">{photo.alt}</h3>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default SectionTwo;
